class Solution {
    private static final int MOD = 1000000007;

    public int numberOfSequence(int n, int[] sick) {
        long ways = 1;
        // Calculate gaps between sick children and at the ends
        int[] gaps = new int[sick.length + 1];
        for (int i = 0; i < sick.length; ++i) {
            if (i == 0) gaps[i] = sick[i];
            else gaps[i] = sick[i] - sick[i - 1] - 1;
            if (i == sick.length - 1) gaps[i + 1] = n - 1 - sick[i];
        }

        for (int gap : gaps) {
            ways = (ways * fib(gap + 1)) % MOD; // Use fib to calculate ways to infect each gap
        }

        return (int) ways;
    }

    private long fib(int n) {
        if (n <= 1) return n;
        long a = 0, b = 1;
        for (int i = 2; i <= n; i++) {
            long c = (a + b) % MOD;
            a = b;
            b = c;
        }
        return b;
    }
}
